import React from "react";
import { NavLink } from 'react-router-dom';

function NavBar() {
    return (
        <nav>
            <NavLink exact to="/">Home</NavLink>
            <NavLink to="/Form">Add Item</NavLink>
            <NavLink to="/Closet">Current Closet</NavLink>
        </nav>
    );
}

export default NavBar;
